var newWorkspace = apogee.util.jsonCopy(workspace_p3);

var jsEntries = newWorkspace.jsLinks.map( url => {return {"url":url,"entryType":"js link"}});
var cssEntries = newWorkspace.cssLinks.map( url => {return {"url":url,"entryType":"css link"}});

newWorkspace.library = jsEntries.concat(cssEntries);
delete newWorkspace.jsLinks;
delete newWorkspace.cssLinks;

newWorkspace.version = .31;

return newWorkspace;
